void setup()
{
    pinMode(BUTTON_PIN, INPUT_PULLUP);
    // initialize serial communication
    Serial.begin(115200);

    // initialize the OLED display
    if (!display.begin(SSD1306_SWITCHCAPVCC, SCREEN_I2C_ADDR))
    {
        Serial.println(F("SSD1306 allocation failed"));
        for (;;)

            ;
    }
    display.display();
    delay(1000);
    display.clearDisplay();

    // initialize LED and buzzer pins
    pinMode(LED_PIN, OUTPUT);
    pinMode(BUZZER_PIN, OUTPUT);
    pinMode(BUTTON_PIN, INPUT_PULLUP);

    // connect to WiFi
    WiFi.begin(ssid, password);
    display.setTextSize(1);
    display.setTextColor(SSD1306_WHITE);
    display.setCursor(0, 0);
    // display.print("Connecting to WiFi...");
    playLoadingAnimation();
    display.display();

    while (WiFi.status() != WL_CONNECTED)
    {
        delay(500);
        Serial.print(".");
    }

    playWifiAnimation();

    // WiFi connected
    display.clearDisplay();
    display.setTextSize(2); // Increase text size
    display.setTextColor(SSD1306_WHITE);
    int16_t x1, y1;
    uint16_t w, h;
    display.getTextBounds("Connected", 0, 0, &x1, &y1, &w, &h);
    display.setCursor((SCREEN_WIDTH - w) / 2, (SCREEN_HEIGHT - h) / 2); // Center the text
    display.print("Connected");
    display.display();
    Serial.println("WiFi connected");

    // make two short beeps
    for (int i = 0; i < 2; i++)
    {
        digitalWrite(BUZZER_PIN, HIGH);
        delay(40);
        digitalWrite(BUZZER_PIN, LOW);
        delay(40);
    }

    displayPage(currentPage);
}

void loop()
{
    // Reserve a small bottom portion of the screen to show the page in circular format
    display.fillRect(0, SCREEN_HEIGHT - 10, SCREEN_WIDTH, 10, SSD1306_BLACK); // Clear the bottom portion
    for (int i = 0; i < 3; i++)
    {
        int x = (SCREEN_WIDTH / 2) - 20 + (i * 20); // Adjust the x position for each circle
        int y = SCREEN_HEIGHT - 5;                  // Adjust the y position for the circles
        if (i == currentPage)
        {
            display.fillCircle(x, y, 3, SSD1306_WHITE); // Filled circle for the current page
        }
        else
        {
            display.drawCircle(x, y, 3, SSD1306_WHITE); // Hollow circle for other pages
        }
    }
    display.display();

    if (digitalRead(BUTTON_PIN) == LOW)
    {
        // Make the buzzer beep for 40 ms to let the user know that the button is pressed
        digitalWrite(BUZZER_PIN, HIGH);
        delay(40);
        digitalWrite(BUZZER_PIN, LOW);
        delay(200); // debounce delay
        currentPage = (currentPage + 1) % 3;
        displayPage(currentPage);
    }

    // Call playLoadingAnimation when WiFi is not connected
    if (WiFi.status() != WL_CONNECTED)
    {
        playLoadingAnimation();
    }
    else
    {
        if (digitalRead(BUTTON_PIN) == LOW)
        {
            delay(200); // debounce delay
            currentPage = (currentPage + 1) % 3;
            displayPage(currentPage);
        }
    }
}

void displayPage(int page)
{
    display.clearDisplay();
    switch (page)
    {
    case 0:
        getISSCoordinates();
        break;
    case 1:
        getISSVelocityAndAltitude();
        break;
    case 2:
        displayAstronauts();
        break;
    }
    display.display();
}

void playWifiAnimation()
{
    for (int i = 0; i < FRAME_COUNT; i++)
    {
        display.clearDisplay();
        display.drawBitmap(32, 0, frames[i], FRAME_WIDTH, FRAME_HEIGHT, 1);
        display.display();
        delay(FRAME_DELAY); // Animation delay
    }
}

void playLoadingAnimation()
{

    while (WiFi.status() != WL_CONNECTED)
    {
        for (int i = 0; i < FRAME_COUNT; i++)
        {
            display.clearDisplay();
            display.drawBitmap(32, 0, frames2[i], FRAME_WIDTH, FRAME_HEIGHT, 1);
            display.display();
            delay(FRAME_DELAY); // Animation delay
        }
    }
}

// Calculate distance with Haversine formula
float calculateDistance(float lat1, float lon1, float lat2, float lon2)
{
    const float R = 6371.0; // Radius of the Earth in kilometers
    float dLat = radians(lat2 - lat1);
    float dLon = radians(lon2 - lon1);
    float a = sin(dLat / 2) * sin(dLat / 2) +
              cos(radians(lat1)) * cos(radians(lat2)) *
                  sin(dLon / 2) * sin(dLon / 2);
    float c = 2 * atan2(sqrt(a), sqrt(1 - a));
    float distance = R * c;
    return distance;
}

